import React, {Component} from 'react'
import { Icon, Button, Grid} from 'semantic-ui-react';


class Tags extends Component {
    constructor(props){
        super()
        this.state = {
            getTags: props.tags
        }
    }

    handleClick = () => {
        return "SAY HELLO!";
    }


    render(){
        return (
            <div>
                <Grid>
                    <Grid.Row columns={2}>
                    return {this.state.getTags.map((tag, index) => {
                        return <Button onClick={this.handleClick}>{tag}</Button>  
                    })}
                    </Grid.Row>
                </Grid>
            </div>
        )
    }
}

export default Tags 

